import './index.css'

// props 接口
interface IProps {
  placeholder: string,
  options: Array<any>
}

// AutoComplete组件
export default function AutoComplete(props: IProps) {

  const {placeholder, options} = props

  return (
    <div>
      <input type="text" className="auto-complete" placeholder={placeholder} />
      <ul>
      {
        options.map(item => {
          return <li>111</li>
        })
      }
      </ul>
    </div>
  );
}
